import React, { Component, use } from "react";
import '../styles/Dashboard.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';


function Dashboard() {

    const [loginStatus, SetloginStatus] = useState("");

    return (
        <Router>
            <Switch>
                <Route path="/">
                    home
                </Route>
                <Route path="/teacher">
                    teacher
                </Route>
            </Switch>
        </Router>
    )
}

export default Dashboard;
